Aerodynamic grain separator АSМ 5 (5 t / h) is designed for cleaning and calibration of: wheat, barley, flax, soybeans, coffee, sunflower, corn and other crops.
Minimum energy consumption due to the use of a European-made frequency converter. The separator efficiency is VERY high.
The output of the cleaned and calibrated material occurs through 7 trays:
- the largest debris (stones, pieces of earth, stems, spikelets, etc.) gets into the first;
- Material from the middle part of the cob, corn cob or sunflower head falls into 2-3 trays. This is the most viable material of the whole heap, seed germination up to 98%;
- the material from the lower part of the ear falls into 4-5 trays - this is a commercial grain, varietal, which will bring maximum profit;
- grain from the upper part of the ear (unripe, light, halves, crushed) falls into 6-7 trays. That in an unclean heap significantly reduces the cost of the harvested crop!

Advantages of the ASM grain cleaning machine
· Work with material of any moisture and debris;
Versatility - works with any bulk materials: grain, cereals, chaff, etc.
· Low power consumption;
· All parts are cut by plasma cutting - assembly precision and separator quality;
· High performance;
· Only high quality European components;
· Does not require complex care and maintenance;
· Modular dismountable system;
· During aerodynamic separation the seeds are not injured, the marketable grain has a high degree of cleaning from grain, mineral and other impurities.
Allows you to prepare high quality and viable seed!

Productivity when harvesting commercial grain up to 5 t / h
Seed material up to 2.5 t / h
Electricity consumption from 0.2 to 0.55 kW / h
Connection 220 V, (optional 380 V)
Weight 140 kg.


For the food industry, we manufacture stainless steel ASM separators.

Other models of ASM aerodynamic separators are also available. Their productivity is 15, 20, 30, 40, 50 t / h.

